def my_func(arr, target):
    arr.sort()
    left, right = 0, len(arr) - 1
    while left < right:
        current_sum = arr[left] + arr[right]
        if current_sum == target:
            return arr[left], arr[right]
        elif current_sum < target:
            left += 1
        else:
            right -= 1
    return None

import numpy as np

def my_func(input1, input2):
    input1 = np.array(eval(input1))  # Convert the input string to a numpy array
    closest_pair = (input1[0], input1[1])
    closest_diff = abs(input1[0] + input1[1] - input2)

    for i in range(len(input1)):
        for j in range(i + 1, len(input1)):
            sum_pair = input1[i] + input1[j]
            if sum_pair == input2:
                return input1[i], input1[j]
            elif abs(sum_pair - input2) < closest_diff:
                closest_diff = abs(sum_pair - input2)
                closest_pair = (input1[i], input1[j])

    return closest_pair

